period = 1.0

NAMES = ["RShoulderPitch", "RShoulderRoll", "RElbowYaw", "RElbowRoll",
            "RHipYawPitch", "RHipRoll", "RHipPitch", "RKneePitch", "RAnklePitch", "RAnkleRoll",
            "LHipYawPitch", "LHipRoll", "LHipPitch", "LKneePitch", "LAnklePitch", "LAnkleRoll",
            "LShoulderPitch", "LShoulderRoll", "LElbowYaw", "LElbowRoll"]
ISABSOLUTE = True

def main(robotIP, PORT = 9559):
  motionProxy = ALProxy("ALMotion", robotIP, PORT)
  # motionProxy.setFallManagerEnabled(False)

  motionProxy.setStiffnesses("Head", 0.85)
  motionProxy.setStiffnesses("LArm", 0.85)
  motionProxy.setStiffnesses("LLeg", 0.85) 
  motionProxy.setStiffnesses("RLeg", 0.85)
  motionProxy.setStiffnesses("RArm", 0.85)

  for matriz in STAND_UP_BACK:
    motionProxy.angleInterpolation(NAMES, matriz, period, ISABSOLUTE)

if __name__ == "__main__":
    parser = argparse.ArgumentParser()
    parser.add_argument("--ip", type=str, default="127.0.0.1",
                        help="Robot ip address")
    parser.add_argument("--port", type=int, default=9559,
                        help="Robot port number")

    args = parser.parse_args()
    main(args.ip, args.port)